CREATE TABLE patientinfo(
   patient_id         INTEGER  NOT NULL PRIMARY KEY 
  ,sex                VARCHAR(6)
  ,age                VARCHAR(4)
  ,country            VARCHAR(14) NOT NULL
  ,province           VARCHAR(17) NOT NULL
  ,city               VARCHAR(15)
  ,infection_case     VARCHAR(45)
  ,infected_by        VARCHAR(22)
  ,contact_number     VARCHAR(10)
  ,symptom_onset_date DATE 
  ,confirmed_date     DATE 
  ,released_date      DATE 
  ,deceased_date      DATE 
  ,state              VARCHAR(8) NOT NULL
);
